import { useEffect, useState } from 'react'
import "./Requests.css"

export const AddNotes = ({ id }) => {

    const [notes, setNotes] = useState({
        notes: "" 
    })

    useEffect(
        () => {
            fetch(`http://localhost:8088/requests?isAccepted=true`)
                .then(response => response.json())
                .then((staffNotes) => {
                    setNotes(staffNotes)
                })
        }, []
    )





    return (
        <>
            <div htmlFor="notes">
                <form>
                    <textarea
                        id="staffNotes"
                        placeholder="Add notes..."
                        value={notes.notes}
                        onChange={(event) => {
                            const copy = { ...notes }
                            copy.notes = event.target.value
                            setNotes(copy)
                        }}>
                    </textarea>
                </form>
            </div>


        </>
    )
}

